    // Check if the string is an identifier (starts with a letter or underscore,
    // followed by letters, digits, or underscores)
    if (!isalpha(str[0]) && str[0] != '_')
        return 0;
    
    for (int i = 1; str[i]; i++) {
        if (!isalnum(str[i]) && str[i] != '_')
            return 0;
    }
    return 1;
